import Link from "next/link";

const titleBarStyle = {
  margin: 20,
  padding: 20,
  border: "1px solid #DDD",
};

const TitleBar = props => (
  <div style={titleBarStyle}>
    <h3>{props.title}</h3>
  </div>
);

export default TitleBar;
